import {useEffect,useState } from "react";
import { Link } from "react-router-dom";




function Cart(){

  const[data,setData]=useState([])
  const[total,setTotal]=useState(0)
  useEffect(()=>{
        fetch("http://localhost:3006/brand")
    .then((res) => {
      return res.json()
    })
    .then((resp) => {
      setData(resp)
    })
  },[])
  const Delete=(id)=>{
    fetch("http://localhost:3006/brand/"+id,{
        method:"DELETE"
    })
    window.location.reload()
   }
   const [value,setValue]=useState(1)

   const increment=()=>{
       setValue(value+1)
   }
 
   const decrement=()=>{
       setValue(value-1)
   }
   
   useEffect(() => {
    fetch("http://localhost:3006/brand")
        .then((res) => {
            return res.json()
        })
        .then((resp) => {
            setData(resp)
            const total=resp.reduce((acc,item)=>acc+parseFloat(item.price),0)
            setTotal(total)
        })
}, [])


    return(
        <div>
          <div style={{fontSize:"30px",marginTop:"30px",marginLeft:"50px",color:"red"}}>
            <Link to="/control">
              <a><i class="fa-solid fa-house"></i></a>
              </Link>
              <h2 style={{marginLeft:"500px"}}> Total Price:{total}</h2>
          </div>
            <div className="five">
            {data.map((one) => (
                <ul style={{ listStyle: "none" }}>
                  <div id="b">
                    <img src={one.img}style={{width: "200px", height: "200px", marginLeft: "8px" }} ></img>
                    <li> <span style={{ fontSize: "18px", marginLeft: "35px" }}>  Brand : </span> {one.brand} </li>
                    <li style={{ marginLeft: "35px" }}>{one.collection}</li>
                    <li> <span style={{ fontSize: "18px", marginLeft: "35px" }}> Model : </span> {one.model} </li>
                    <li style={{ marginLeft: "35px" }}>{one.reference}</li>
                    <li style={{ marginLeft: "35px" }}>{one.complement}</li>
                    <li> <span style={{ fontSize: "18px", marginLeft: "35px" }}> Year : </span>{one.year}</li>
                    <li> <span style={{ fontSize: "18px", marginLeft: "35px" }}> Price :</span>{one.price}<a style={{ color: "blue", fontSize: "20px" }}>$</a></li>
                    <li className="page-item" style={{marginLeft:"70px"}}>
                    <a href="#" className="page-link" onClick={decrement} >-</a>
                   </li>
                   <li className="page-item" style={{marginLeft:"70px"}}>
                    <a href="#" className="page-link"  >{value}</a>
                   </li>
                   <li className="page-item">
                    <a href="#" className="page-link" onClick={increment} style={{marginLeft:"70px"}}>+</a>
                   </li>
                    <button id="a" className="btn btn-success" onClick={()=>{Delete(one.id)}} >Remove</button>
                    <li >
                    
                    </li>
                  </div>
                </ul>
              ))}
            </div>
        </div>
    )
}

export default Cart;
